import React from "react";
import { Link, Outlet, useNavigate } from "react-router-dom";

const Menubar = () => {
  const navigate = useNavigate();
  const goHome = () => {
    navigate("/");
  };

  return (
    <div>
      <ul>
        <l1>
          <Link to="/">Home</Link>
        </l1>
        <li>
          <Link to="/movies">Movies</Link>
        </li>
      </ul>

      <Outlet />
      <button onClick={goHome} type="button">
        홈으로 돌아가기
      </button>
    </div>
  );
};

export default Menubar;
